local function highlight(list)
  local cmds = {}
  for group, opts in pairs(list) do
    table.insert(cmds, string.format(
      "highlight %s guifg=%s guibg=%s gui=%s guisp=%s",
      group,
      opts.fg or "NONE",
      opts.bg or "NONE",
      opts.style or "NONE",
      opts.sp or "NONE"
    ))
  end
  vim.cmd(table.concat(cmds, "\n"))
end

local function link(list)
  local cmds = {}
  for group, opts in pairs(list) do
    table.insert(cmds, string.format("highlight! link %s %s", group, opts))
  end
  vim.cmd(table.concat(cmds, "\n"))
end

local function clear()
  if vim.g.colors_name then
    vim.cmd("hi clear")
  end
end

local function set_info()
  vim.cmd("set termguicolors")
  vim.cmd("set background=light")
  vim.g.colors_name = "dawnfox"
end

local function set_terminal()
  local colors = {
    "#575279", "#b4637a", "#618774", "#ea9d34", "#286983", "#907aa9", "#56949f", "#e5e9f0", "#5f5695", "#c26d85", "#629f81", "#eea846", "#2d81a3", "#9a80b9", "#5ca7b4", "#e6ebf3",
  }
  for i, c in ipairs(colors) do
    local n = "terminal_color_" .. i - 1
    vim.g[n] = c
  end
  if vim.fn.has("nvim") == 0 then
    vim.g.terminal_ansi_colors = vim.list(colors)
  end
end

